import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 12, height: 12, viewBox: "0 0 12 12", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M3.5 2C2.67 2 2 2.67 2 3.5v4C2 8.33 2.67 9 3.5 9H4v1a.5.5 0 00.76.43L7.14 9H8.5c.83 0 1.5-.67 1.5-1.5v-4C10 2.67 9.33 2 8.5 2h-5z", fill: primaryFill }));
};
const Comment12Filled = wrapIcon(rawSvg({}), 'Comment12Filled');
export default Comment12Filled;
